var uxp = require('uxp');
var scenegraph = require('scenegraph');

const METAMORPH_URL =
  "https://api.metamorph.designwitheve.com/predict/?minimum_probability=0.8";

const DOCUMENT_CENTER = [0, 0];

var img$k = "data:image/png;base64,";

