var img$6 = "data:image/png;base64,";

var img$5 = "data:image/png;base64,";

var img$4 = "data:image/png;base64,";

var img$3 = "data:image/png;base64,";

var img$2 = "data:image/png;base64,";

var img$1 = "data:image/png;base64,";

var img = "data:image/png;base64,";

var UI_ELEMENTS = {
  alert: img$k,
  button: img$j,
  card: img$i,
  checkbox_checked: img$h,
  checkbox_unchecked: img$g,
  chip: img$f,
  data_table: img$e,
  dropdown_menu: img$d,
  floating_action_button: img$c,
  grid_list: img$b,
  image: img$a,
  label: img$9,
  menu: img$8,
  radio_button_checked: img$7,
  radio_button_unchecked: img$6,
  slider: img$5,
  switch_disabled: img$4,
  switch_enabled: img$3,
  text_area: img$2,
  text_field: img$1,
  tooltip: img,
};

function addElement(image, element, artboard) {
  const { name } = element;
  const { x, y } = element.position;
  const { width, height } = element.dimension;

  const imageFill = new scenegraph.ImageFill(image);
  const imageWidth = imageFill.naturalWidth;
  const imageHeight = imageFill.naturalHeight;

  const scale = Math.min(width / imageWidth, height / imageHeight);

  const rectNode = new scenegraph.Rectangle();
  rectNode.name = name;
  rectNode.width = imageWidth * scale;
  rectNode.height = imageHeight * scale;
  rectNode.fill = imageFill;
  artboard.addChild(rectNode);
  rectNode.moveInParentCoordinates(x, y);
}

function generateArtboard(id, width, height, uiScreen) {
  const [x, y] = DOCUMENT_CENTER;

  const artboard = new scenegraph.Artboard();
  artboard.name = `wireframe_${id}`;
  artboard.width = width;
  artboard.height = height;
  artboard.fill = new scenegraph.Color("#F2F2F2");
  artboard.dynamicLayout = true;

  scenegraph.root.addChild(artboard);
  artboard.moveInParentCoordinates(x, y);

  uiScreen.objects.forEach((element) => {
    const { name } = element;

    const image = UI_ELEMENTS[name];

    addElement(image, element, artboard);
  });
}

// eslint-disable-next-line no-undef
const { error } = require("./lib/dialogs");

const fs = uxp.storage.localFileSystem;

const generateScreen = async () => {
  try {
    const lofiSketch = await fs.getFileForOpening({
      types: uxp.storage.fileTypes.images,
    });
    if (!lofiSketch) return;

    const formData = new FormData();

    formData.append("image", lofiSketch);

    const response = await fetch(METAMORPH_URL, {
      method: "POST",
      body: formData,
    });
    if (!response.ok) {
      throw new Error(`Server overloaded`);
    }

    const uiScreen = await response.json();

    const { id, width, height } = uiScreen;

    generateArtboard(id, width, height, uiScreen);
  } catch (err) {
    await error("Server failed", `Sorry! ${error.message}`);
  }
};

var index = {
  commands: {
    detectUIElements: generateScreen,
  },
};

module.exports = index;
